import React, { useEffect, useState } from 'react'
import './Bestseller.css'

function Bestseller(props) {

    let [bestseller, setbestseller] = useState([])
    useEffect(()=>{
        fetch('http://localhost:8080/text/bestseller/'+props.lang)
     
        .then(res=>res.json())
        .then(json=>setbestseller(json))
    },[props.lang])
    console.log(bestseller)
  return (
    <div>

{
     
     bestseller.map((statss, index) => (
      <div className="Rubview-card"> 
        <img src={statss.image} width="120px"></img>
        <div className='Rubview-card-text'>
        <h3>{statss.title}</h3>
        <a href={"/detail/"+statss.id}> view Product</a>
      
        </div>
      </div>
  
     ))}


    </div>
  )
}

export default Bestseller
